string analysis(char& current,char& next,int& state)
{
	if (current == ' ')
	{
		return "";
	}
	state1=dfaTable[state][CODE.find_first_of(current)];
	if(state1!=-1)
	{
		state2=dfaTable[state1][CODE.find_first_of(next)];
		if(state2==-1)
		{
			state=348;
			if (act(endS[state1]) == "num" && (pos + 1 < c_save.size()) && (CODE.find_first_of(c_save[pos - 1]) < 53))
			{
				out << current;
				int i = pos - 1;
				while (CODE.find_first_of(c_save[i]) < 63)
				{
					out << c_save[i];
					i = pos;
					pos++;
				}
				pos--;
				c = c_save[pos];
				current = c;
				pos++;
				next = c_save[pos];
				out << "#";
				return"fffffff";
			}
			else
			{
				out << current << "#";
				return(act(endS[state1]));
			}
		}
		state=state1;
		if (current == '/' && next == '/')
		{
				flag = 1;
				return;
		}
		if (current == '/' && flag == 1)
		{
				flag = 0;
				return;
		}
		out<<current;
		return"";
	}
	else return"#fffffff";
}

